             <h4>{x.Name}</h4>
             <h4>{x.Dept}</h4>
             <h4>{x.Reg}</h4>
             <div id="con" style={{marginTop:'20px'}}>
             <table className="table  table-hover" style={{width:'80%'}}>
              <tbody>
                <tr >
                  <th >Student Email:</th>
                  <td >{x.Email}</td>
                </tr>
                <tr >
                  <th >Student Gender:</th>
                  <td >{x.Gender}</td>
                </tr>
                <tr>
                  <th >Student Address:</th>
                  <td >{x.Address}</td>
                </tr>
              </tbody>
            </table>
             </div>
          </div>
        </div>
      </div>
      </div>
